#每个字段都创建索引
def CreatIndex(collection,selector):
    MongoIndexField = ['CHROM', 'POS', 'ID', 'QUAL', 'ALT', 'FILTER', 'REF', 'INFO', 'SAMPLES', 'SEQNAME', 'FEATURE',
                       'START', 'END', 'ENTREZ_GENE_ID', 'ENTREZ_GENE_SYMBOL', 'HPO_TERM_NAME', 'HPO_TERM_ID']
    map = Code("""
    function(){
        for (var key in this) { 
          emit(key, null);
        }
    }
    """)
    reduce=Code("""
        function (key, values) {
            return key;
        }
    """)
    keys = collection.map_reduce(map, reduce, out = {'inline' : 1} , full_response = True)
    for key in keys['results']:
        if key['value'].upper() in MongoIndexField:
            try:
                collection.create_index([(key['value'], 1)], background=True)
            except:
                continue
    #建立INFO字段的全文索引，暂时不用，内存消耗严重
    # collection.create_index({"INFO":'text'})
    #ontology字段创建索引
    # ontologyFields = ['HPO','DO','SO','MC','GO']
    # for field in ontologyFields:
    #     collection.create_index([('INFO.' + field, 'hashed')], background=True)
    #!!!!!ontology字段索引 db.ensureIndex({key1:"text",key2:"text"})
    if selector == 1:
        collection.create_index([('INFO.HPO', 'text'),('INFO.DO', 'text'),('INFO.SO', 'text'),('INFO.MC', 'text'),('INFO.GO', 'text')], background=True)
    elif selector ==2:
        collection.create_index([('INFO.CLNDISDB', 'text'),('INFO.MC', 'text'),('INFO.CLNVCSO', 'text'),('INFO.GENEINFO', 'text')],background=True)
    return

