def GetDOID():
    connection = MongoClient(MongodbAddrRemote)
    NAcollect = connection.mydb.NA12878_HG001
    regx = re.compile(".*" + "DOID:" + ".*", re.IGNORECASE)
    results=NAcollect.find({"INFO.DO":regx})
    DOID_list = []
    for result in results:
        str1 = result["INFO"]["DO"][0]
        doid = str1[:str1.index("|")]
        DOID_list.append(doid)
    DOID_list = list(set(DOID_list))
    print(DOID_list)

