def compareFuncHPO(HPO):
    global counttens
    global countunit
    if countunit > 15 and counttens > 8:
        return
    HPID=HPO.split(":")[1]
    DIRstart = time.time()
    #MongodbAddrRemote = "mongodb://123.207.240.94:28019"
    MongodbAddrRemote = "mongodb://localhost:27017"
    connection = MongoClient(MongodbAddrRemote)
    NAcollect = connection.OntoVarSearch.NA12878_HG001
    # regx = re.compile(".*" + "DOID:"+DOID + ".*", re.IGNORECASE)
    # results=NAcollect.find({ "INFO.DO": regx })
    results=NAcollect.find({"$text": {"$search": "\""+HPO+"\""}})
    pos_na=[]
    for dir_naresult in results:
        pos_na.append(dir_naresult["POS"])

    pos_na = list(set(pos_na))
    DIRend = time.time()
    DIRtotal = DIRend - DIRstart
    if len(pos_na) < 10 and countunit > 15:
        return
    if len(pos_na) > 10 and counttens > 8:
        return
    #print("DIR: ",DIRtotal,' pos count: ',len(pos_na))

    #print(len(pos_na),'---',pos_na)



    #############################################################
    INDstart = time.time()
    #MongodbAddrRemote = "mongodb://123.207.240.94:28019"
    connection = MongoClient(MongodbAddrRemote)
    HPOcollect = connection.OntoVarSearch.hpoteam
    results_hpid=HPOcollect.find({"DB":"OMIM", "HPO_ID":HPO})
    OMIMs = []
    if results_hpid.count():
        for result_doid in results_hpid:
            DbXref = result_doid['DB_Reference']
            if isinstance(DbXref, list):
                for xref in DbXref:
                    if 'OMIM' in xref:
                        OMIMs.append(xref)
            else:
                if 'OMIM' in DbXref:
                    OMIMs.append(DbXref)

    if len(OMIMs) < 1:
        return

    ClinVarcollect = connection.OntoVarSearch.hg19_clinvar_20191007
    count = 0
    result_pos=[]
    for omimid in OMIMs:
        # regx = re.compile(".*" + omimid + ".*", re.IGNORECASE)
        # omim_results=ClinVarcollect.find({ "INFO.CLNDISDB": regx })
        omim_results = ClinVarcollect.find({"$text": {"$search":"\""+omimid+"\""}})
        for omim_result in omim_results:
            chrom = omim_result["CHROM"]
            pos = omim_result["POS"]
            preNA_result = NAcollect.find_one({"CHROM":str(chrom),"POS":int(pos)})
            if preNA_result:
                result_pos.append(pos)
    result_pos = list(set(result_pos))

    INDend = time.time()
    INDtotal = INDend - INDstart
    if len(pos_na) == len(result_pos):
        if len(pos_na) < 10:

            countunit+=1
        elif len(pos_na) >= 10:

            counttens+=1
        print("HPO: ",HPO,"---DIR time: ", DIRtotal,"---IND time: ",INDtotal, ' pos count: ',len(result_pos))


