def compareFuncGO(GO):
    GOID=GO.split(":")[1]
    DIRstart = time.time()
    #MongodbAddrRemote = "mongodb://123.207.240.94:28019"
    MongodbAddrRemote = "mongodb://localhost:27017"
    connection = MongoClient(MongodbAddrRemote)
    NAcollect = connection.OntoVarSearch.NA12878_HG001
    # regx = re.compile(".*" + "DOID:"+DOID + ".*", re.IGNORECASE)
    # results=NAcollect.find({ "INFO.DO": regx })
    results=NAcollect.find({"INFO.GO":GO})
    pos_na=[]
    for dir_naresult in results:
        if dir_naresult["POS"] not in pos_na:
            pos_na.append(dir_naresult["POS"])

    pos_na = list(set(pos_na))
    if len(pos_na) < 1:
        return
    print(GO)
    DIRend = time.time()
    DIRtotal = DIRend - DIRstart
    print("dir: ", len(pos_na), "---time:",DIRtotal)
    #################################################################

    INDstart = time.time()
    GOAcollection = connection.OntoVarSearch.goa
    Generesults = GOAcollection.find({"GO_ID":GO})
    genelist=[]
    for Generesult in Generesults:
        if Generesult["DB_Object_Symbol"] not in genelist:
            genelist.append(Generesult["DB_Object_Symbol"])

    ClVcollect = connection.OntoVarSearch.hg19_clinvar_20191007
    pos_clv = []
    #print(genelist)
    for gene in genelist:
        regx = re.compile(".*" + gene + ".*", re.IGNORECASE)
        CLVresults=ClVcollect.find({ "INFO.GENEINFO": regx })
        #CLVresults = ClVcollect.find({"$text": {"$search": gene}})
        #CLVresults = ClVcollect.find({"INFO.GENEINFO": gene})
        for CLVresult in CLVresults:
            chrom = CLVresult["CHROM"]
            pos = CLVresult["POS"]
            if pos not in pos_clv:
                preNA_result = NAcollect.find_one({"CHROM": str(chrom), "POS": int(pos)})
                if preNA_result:
                    pos_clv.append(pos)
        #pos_clv = list(set(pos_clv))
    INDend = time.time()
    print("INdir: ", len(pos_clv),"---time:",INDend-INDstart)
    with open('experiResult.txt','a') as f:
        fstr = GO+"---"+"dir: "+str(len(pos_na))+"---time:"+str(DIRtotal)+"---IND: "+str(len(pos_clv))+"---time:"+str(INDend-INDstart)+'\n'
        f.write(fstr)

def processGOtxt(gofile):
    golist=[]
    with open(gofile,'r') as fr:
        lines = fr.readlines()
        for line in lines:
            DirCount = int(line.split("---")[1].split(":")[1])
            IndCount = int(line.split("---")[3].split(":")[1])
            if DirCount == IndCount:
                line=line.strip('\n')
                golist.append("GO" + line)
    for go in golist:
        print(go)

